import { Component, OnInit } from '@angular/core';
import { LocalStorageService } from '../../services/local-storage.service';
import { CommonModule } from '@angular/common';
import pdfMake from "pdfmake/build/pdfmake";
import pdfFonts from "pdfmake/build/vfs_fonts";

(pdfMake as any).vfs = pdfFonts.vfs;

@Component({
  selector: 'app-report-pdf',
  imports: [CommonModule],
  templateUrl: './report-pdf.component.html',
  styleUrl: './report-pdf.component.css',
  providers: [LocalStorageService]
})
export class ReportPDFComponent implements OnInit{

  employeeInfoList: any[] = [];

  constructor(private localStorageService: LocalStorageService) { }

  ngOnInit(): void {
    //this.employeeInfoList = JSON.parse(this.localStorageService.getData('employeeswithInfo') || []);
    const data = this.localStorageService.getData('employeeswithInfo');

    if (typeof data === 'string') {
      this.employeeInfoList = JSON.parse(data);
    } else {
      this.employeeInfoList = data || [];
    }

  }
  createPDF(){
    console.log("hit");
    console.log("",this.employeeInfoList);
    const tableBody: any = [
      [ //employee.emplId, employee.employeeName, employee.employeeDesignation
        { text: 'Employee ID', style: 'tableHeader' },
        { text: 'Employee Name', style: 'tableHeader' },
        { text: 'Employee Designation', style: 'tableHeader' },
      ],
      ...this.employeeInfoList.map(emp => [
        emp.emplId,
        emp.employeeName,
        emp.employeeDesignation,
      ]),
    ];


    const documentDefinition: any = {
      content: [
        { text: 'Employee Report', fontSize: 22, bold: true, alignment: 'center', margin: [0, 0, 0, 20] },

        { image: this.getBase64Image(), width: 150, alignment: 'center', margin: [0, 0, 0, 20] },

        {
          table: {
            headerRows: 1,
            widths: ['33.3%', '33.3%', '33.3%' ],
            body: tableBody,
          },
          layout: 'lightHorizontalLines',
        },

        // Footer Text
        { text: 'Generated on: ' + new Date().toLocaleDateString(), alignment: 'right', fontSize: 10, margin: [0, 30, 0, 0] }
      ],
      styles: {
        header: {
          fontSize: 18,
          bold: true,
          margin: [0, 0, 0, 10],
        },
        tableHeader: {
          bold: true,
          fontSize: 12,
          color: 'white',
          fillColor: '#2a3f5f',
        },
      },
    };

    pdfMake.createPdf(documentDefinition).open();
  }

  getBase64Image(): string {
    return 'data:image/png;base64,'; // Replace with actual Base64 image
  }

}
